import React from 'react';
import { useSelector } from 'react-redux';

export const Modal = ({children, className}) => {
    const store = useSelector(state => state)
    const {formSlice} = store
    if(!formSlice.isOpen) return null;
    return (
        <div>
            {children}
        </div>
    )
}
